import "../CSS/Content.css";
import BgndImg from "../Images/BgndImg.jfif";
import Favorite from '@material-ui/icons/Favorite';
import clickme6 from '../Images/clickme6.jpg';
import heartgif from '../Images/heartgif.gif';
function Content(){
    return(
      <div
      class="bg_image"
      style={{
        backgroundImage: 'url('+BgndImg+')',
        backgroundSize: "cover",
      }}
    >
      <h1 style={{fontFamily:"Brush Script MT", textAlign:"center", color:"rgba(0,0.5,0.7,0.8)", fontSize:"100px"}}>Happiest Birthday<br/>dear<br/>Shrinidhi<img height="20%" width="20%" src={heartgif} alt="heart"/></h1>
      <div style={{textAlign:"center"}}>
        <div class="click">
      <img height="20%" width="20%" src={clickme6} alt="heart"/>
        </div>
      </div>
      
     </div>
     
    )
}

export default Content;
